import { Component, OnInit, ViewChild, ElementRef } from '@angular/core';
import { CommonModule } from '@angular/common';
import { FormsModule } from '@angular/forms';
import jsPDF from 'jspdf';
import autoTable from 'jspdf-autotable';

import {
  IonContent,
  IonHeader,
  IonTitle,
  IonToolbar,
  IonBackButton,
  IonButtons,
  IonButton,
  IonSpinner,
  IonIcon,
} from '@ionic/angular/standalone';
import { HttpClient, HttpClientModule } from '@angular/common/http';
import { TranslateModule, TranslateService } from '@ngx-translate/core';

import { Capacitor } from '@capacitor/core';
import { Filesystem, Directory } from '@capacitor/filesystem';
import { Share } from '@capacitor/share';

interface Statement {
  monthNameWithDate: string;
  pensionId: string;
  grossPension: number;
  arrear: number;
  lotedthContact: number;
  netPension: number;
  tds: number | null;
  receiptNumber: string;
  receiptDate: string;
}

/** ================= Helpers ================= **/

function normalizeBase64DataUrl(dataUrl: string): string {
  if (!dataUrl) return dataUrl;
  const [head, b64 = ''] = dataUrl.split(',');
  let body = b64.replace(/\s/g, '').replace(/ /g, '+');
  const pad = body.length % 4;
  if (pad) body += '='.repeat(4 - pad);
  return `${head},${body}`;
}

function getImgFormat(dataUrl: string): 'PNG' | 'JPEG' {
  if (/^data:image\/png;/i.test(dataUrl)) return 'PNG';
  if (/^data:image\/jpe?g;/i.test(dataUrl)) return 'JPEG';
  return 'JPEG';
}

function blobToBase64(blob: Blob): Promise<string> {
  return new Promise((resolve, reject) => {
    const r = new FileReader();
    r.onerror = () => reject(r.error);
    r.onload = () => {
      const result = r.result as string;
      resolve(result.split(',')[1] ?? '');
    };
    r.readAsDataURL(blob);
  });
}

async function savePdfCrossPlatform(doc: jsPDF, fileName = 'TDS_Report.pdf') {
  if (!Capacitor.isNativePlatform()) {
    doc.save(fileName);
    return;
  }
  const blob = doc.output('blob');
  const base64 = await blobToBase64(blob);

  const path = `NPPF/${Date.now()}_${fileName}`;
  const { uri } = await Filesystem.writeFile({
    path,
    data: base64,
    directory: Directory.Documents, // good default; user can still share/move it
    recursive: true,
  });

  await Share.share({
    title: fileName,
    text: 'TDS report',
    url: uri,
    dialogTitle: 'Share your PDF',
  });
}

/** ============== Replace these with your full base64 strings ============== **/
const LOGO_BASE64 =
  'data:image/png;base64,';

const STAMP_BASE64 =
  'data:image/jpeg;base64,';

// <-- full JPEG data URL
/** ========================================================================= **/

@Component({
  selector: 'app-tds',
  standalone: true,
  templateUrl: './tds.page.html',
  styleUrls: ['./tds.page.scss'],
  imports: [
    IonIcon,
    IonSpinner,
    IonButton,
    IonButtons,
    IonBackButton,
    IonContent,
    IonHeader,
    IonTitle,
    IonToolbar,
    CommonModule,
    TranslateModule,
    FormsModule,
    HttpClientModule,
  ],
})
export class TDSPage implements OnInit {
  @ViewChild('tdsTable', { static: false })
  tdsTable!: ElementRef<HTMLTableElement>;

  statements: Statement[] = [];
  loading = true;

  userDetails = {
    name: '',
    commencementDate: '',
    address: '',
    pensionId: '',
    cid: '',
    accountNumber: '',
  };

  currentLang: string;

  constructor(private http: HttpClient, private translate: TranslateService) {
    this.currentLang = this.translate.currentLang;
    this.translate.onLangChange.subscribe(
      (event) => (this.currentLang = event.lang)
    );
  }

  ngOnInit(): void {
    const pensionId = localStorage.getItem('pensionId') ?? '';
    if (!pensionId) {
      this.loading = false;
      return;
    }

    this.userDetails = {
      name: localStorage.getItem('name') ?? 'Aum Sangay Choden Kesang',
      commencementDate: localStorage.getItem('commencementDate') ?? '',
      address: localStorage.getItem('address') ?? 'Thimphu',
      pensionId: pensionId,
      cid: localStorage.getItem('cid') ?? '11410007947',
      accountNumber: localStorage.getItem('accountNumber') ?? '204665704',
    };

    const url = `https://pensionapp.nppf.org.bt/api/pension-statements/${pensionId}`;
    this.http
      .get<{ status: boolean; message: string; data: Statement[] }>(url)
      .subscribe({
        next: (res) => {
          this.statements = res.data ?? [];
          this.loading = false;
        },
        error: () => {
          this.statements = [];
          this.loading = false;
        },
      });
  }

  formatNumber(val: number): string {
    return typeof val === 'number' ? val.toLocaleString('en-IN') : '-';
    // if 0 is valid value, it still prints "0"
  }

  sum(arr: number[]): number {
    return arr.reduce((total, n) => total + (n || 0), 0);
  }

  async exportPdf(): Promise<void> {
    const doc = new jsPDF({ orientation: 'p', unit: 'pt', format: 'a4' });
    const margin = 40;
    const pageWidth = doc.internal.pageSize.getWidth();
    const currentDate = new Date().toLocaleDateString('en-GB');

    // Clean + detect image formats
    const logoBase64 = normalizeBase64DataUrl(LOGO_BASE64);
    const stamp = normalizeBase64DataUrl(STAMP_BASE64);
    const logoFmt = getImgFormat(logoBase64); // expected 'PNG'
    const stampFmt = getImgFormat(stamp); // expected 'JPEG'

    const logoWidth = 250;
    const logoHeight = 60;
    const stampWidth = 100;
    const stampHeight = 100;
    const logoX = (pageWidth - logoWidth) / 2;

    // Header
    doc.setFontSize(8);
    doc.setFont('helvetica', 'bold');
    doc.addImage(logoBase64, logoFmt, logoX, 20, logoWidth, logoHeight);

    doc.setTextColor('#000');
    doc.setFontSize(8);
    doc.setFont('helvetica', 'bold');
    doc.text('Pension Statement for the Income Year 2023', pageWidth / 2, 95, {
      align: 'center',
    });

    doc.setFontSize(10);
    doc.setFont('helvetica', 'normal');
    doc.setTextColor('#0000EE');
    doc.textWithLink('Pension Transaction Details', pageWidth / 2, 110, {
      align: 'center',
      url: '',
    });

    doc.setTextColor('#000');
    doc.setFontSize(10);
    doc.text(`Date : ${currentDate}`, pageWidth - margin, 40, {
      align: 'right',
    });

    // Info block
    const infoLeft = [
      `Name: ${this.userDetails.name}`,
      `Address: ${this.userDetails.address}`,
      `Pension ID No.: ${this.userDetails.pensionId}`,
    ];
    const infoRight = [
      `Commencement Date : ${this.userDetails.commencementDate}`,
      `Pension Savings A/c.: ${this.userDetails.accountNumber}`,
      `TPN No / CID #: ${this.userDetails.cid}`,
    ];

    let y = 130;
    for (let i = 0; i < infoLeft.length; i++) {
      doc.text(infoLeft[i], margin, y);
      doc.text(infoRight[i], pageWidth / 2 + 30, y);
      y += 18;
    }

    // Table
    const tableBody = this.statements.map((s) => [
      s.monthNameWithDate,
      this.formatNumber(s.grossPension),
      s.arrear ?? 0 ? this.formatNumber(s.arrear) : '-',
      s.lotedthContact ?? 0 ? this.formatNumber(s.lotedthContact) : '-',
      this.formatNumber(s.netPension),
      s.tds != null ? this.formatNumber(s.tds) : '-',
      s.receiptNumber || 'NA',
      s.receiptDate || 'NA',
    ]);

    // Totals row
    const total = {
      gross: this.sum(this.statements.map((s) => s.grossPension)),
      arrear: this.sum(this.statements.map((s) => s.arrear)),
      lotedh: this.sum(this.statements.map((s) => s.lotedthContact)),
      net: this.sum(this.statements.map((s) => s.netPension)),
    };

    tableBody.push([
      'Total',
      this.formatNumber(total.gross),
      this.formatNumber(total.arrear),
      this.formatNumber(total.lotedh),
      this.formatNumber(total.net),
      '-',
      '-',
      '-',
    ]);

    autoTable(doc, {
      head: [
        [
          'Month',
          'Gross Pension',
          'Arrears',
          'Lotedh Cont.',
          'Net Pension',
          'TDS',
          'Receipt Number',
          'Receipt Date',
        ],
      ],
      body: tableBody,
      startY: y + 10,
      styles: {
        halign: 'center',
        valign: 'middle',
        fontSize: 9,
      },
      headStyles: {
        fillColor: [255, 255, 255],
        textColor: '#000',
        lineColor: [0, 0, 0],
        lineWidth: 0.5,
      },
      bodyStyles: {
        lineColor: [0, 0, 0],
        lineWidth: 0.25,
      },
      columnStyles: {
        0: { halign: 'left' },
        1: { halign: 'right' },
        2: { halign: 'right' },
        3: { halign: 'right' },
        4: { halign: 'right' },
        5: { halign: 'right' },
        6: { halign: 'center' },
        7: { halign: 'center' },
      },
    });

    // Footer/signature + stamp
    const pageHeight = (doc as any).internal.pageSize.getHeight();
    const bottomLimit = pageHeight - margin;
    const gap = 12;

    let finalY = ((doc as any).lastAutoTable?.finalY ?? y) + 20;

    doc.text('Tashi Dema', margin, finalY);
    doc.text('Pension & Provident Fund Department', margin, finalY + 15);
    doc.text('00975-17536373 M)', margin, finalY + 30);

    const stampX = pageWidth - margin - stampWidth;
    let stampY = finalY + 30 + gap;

    if (stampY + stampHeight > bottomLimit) {
      doc.addPage();
      stampY = margin;
    }

    doc.addImage(stamp, stampFmt, stampX, stampY, stampWidth, stampHeight);

    // Note (wrapped, with divider)
    let noteY = stampY + stampHeight + gap;
    const note =
      'This is a system-generated statement and is considered equivalent to the original statement.';

    const prevFontSize = doc.getFontSize();
    const noteFontSize = 7;
    doc.setFontSize(noteFontSize);

    const linePadding = 6;
    const noteMaxWidth = pageWidth - 2 * margin;

    const noteLines = (doc as any).splitTextToSize?.(note, noteMaxWidth) ?? [
      note,
    ];

    const estLineHeight = noteFontSize + 2;
    const estNoteHeight = noteLines.length * estLineHeight;

    let currPageHeight = (doc as any).internal.pageSize.getHeight();
    let currBottomLimit = currPageHeight - margin;

    if (noteY + estNoteHeight > currBottomLimit) {
      doc.addPage();
      noteY = margin + linePadding;
      currPageHeight = (doc as any).internal.pageSize.getHeight();
      currBottomLimit = currPageHeight - margin;
    }

    const lineY = noteY - linePadding;
    doc.setDrawColor(0);
    doc.setLineWidth(0.5);
    doc.line(margin, lineY, pageWidth - margin, lineY);
    doc.text(noteLines as any, pageWidth / 2, noteY, { align: 'center' });
    doc.setFontSize(prevFontSize);

    //  Cross-platform save
    await savePdfCrossPlatform(doc, 'TDS_Report.pdf');
  }
}
